import React from 'react';
import { Route, Switch } from 'react-router-dom';

const App = () => {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <h1>Welcome to EcoMarket</h1>
        </Route>
      </Switch>
    </div>
  );
};

export default App;
